import React, {useState} from 'react';

const welcome = ()=>{
    <div>
        <h1>Test</h1>
    </div>
}

class SignUp extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "user",
            form: this.welcome()
        };
    }



    render(){
        return(
            <div>
                {this.state.form}
            </div>
        )
    }
}

export default SignUp;
